from heapq import heappop, heappush

def minPath(grid, k):
    n = len(grid)
    visited = set()
    directions = [(1, 0), (-1, 0), (0, 1), (0, -1)]

    heap = [(grid[0][0], 0, 0, [grid[0][0]])]
    while heap:
        _, x, y, path = heappop(heap)
        if len(path) == k:
            return path
        visited.add((x, y))
        for dx, dy in directions:
            nx, ny = x + dx, y + dy
            if 0 <= nx < n and 0 <= ny < n and (nx, ny) not in visited:
                heappush(heap, (grid[nx][ny], nx, ny, path + [grid[nx][ny]]))

def do_algebra(operators, operands):
    precedence = {'**': 4, '*': 3, '/': 3, '+': 2, '-': 2}

    def infix_to_postfix(expression):
        stack = []
        postfix = []
        for token in expression:
            if token.isdigit():
                postfix.append(token)
            elif token == '(':
                stack.append(token)
            elif token == ')':
                while stack and stack[-1] != '(':
                    postfix.append(stack.pop())
                stack.pop()
            else:
                while stack and precedence.get(stack[-1], 0) >= precedence.get(token, 0):
                    postfix.append(stack.pop())
                stack.append(token)

        while stack:
            postfix.append(stack.pop())

        return postfix

    def evaluate_postfix(postfix):
        stack = []
        for token in postfix:
            if token.isdigit():
                stack.append(int(token))
            else:
                operand2 = stack.pop()
                operand1 = stack.pop()
                if token == '+':
                    stack.append(operand1 + operand2)
                elif token == '-':
                    stack.append(operand1 - operand2)
                elif token == '*':
                    stack.append(operand1 * operand2)
                elif token == '/':
                    stack.append(operand1 / operand2)  # Perform regular division
                elif token == '**':
                    stack.append(operand1 ** operand2)

        return stack[-1]

    expression = []
    for i in range(len(operators)):
        expression.append(str(operands[i]))
        expression.append(operators[i])
    expression.append(str(operands[-1]))

    postfix_expr = infix_to_postfix(expression)
    return evaluate_postfix(postfix_expr)

