def do_algebra(operators, operands):
    precedence = {'**': 4, '*': 3, '/': 3, '+': 2, '-': 2}  # Define operator precedence
    output = []
    stack = []

    def apply_operation(stack, operator):
        if len(stack) < 2:
            return
        second_operand = int(stack.pop())
        first_operand = int(stack.pop())
        if operator == '+':
            stack.append(first_operand + second_operand)
        elif operator == '-':
            stack.append(first_operand - second_operand)
        elif operator == '*':
            stack.append(first_operand * second_operand)
        elif operator == '/':
            stack.append(first_operand // second_operand)
        elif operator == '**':
            stack.append(first_operand ** second_operand)

    for i in range(len(operators)):
        while stack and precedence.get(stack[-1], 0) >= precedence[operators[i]]:
            apply_operation(stack, stack.pop())
        stack.append(str(operands[i]))
        stack.append(operators[i])

    stack.append(str(operands[-1]))

    while len(stack) > 1:
        apply_operation(stack, stack.pop())

    return int(stack[0])

