            return path

        min_path = []
        for dx, dy in [(1, 0), (-1, 0), (0, 1), (0, -1)]:
            nx, ny = x + dx, y + dy
            if 0 <= nx < len(grid) and 0 <= ny < len(grid[0]) and not visited[nx][ny]:
                visited[nx][ny] = True
                new_path = dfs(nx, ny, path_len + 1, path + [grid[nx][ny]])
                if new_path and (not min_path or new_path < min_path):
                    min_path = new_path
                visited[nx][ny] = False

        return min_path

    visited = [[False for _ in range(len(grid[0]))] for _ in range(len(grid))]
    result = []
    for i in range(len(grid)):
        for j in range(len(grid[0])):
            visited[i][j] = True
            result = dfs(i, j, 1, [grid[i][j]])
            visited[i][j] = False
            if result:
                return result

    return result

import math

def intersection(interval1, interval2):
    def is_prime(n):
        if n < 2:
            return False
        if n == 2:
            return True
        if n % 2 == 0:
            return False
        for i in range(3, int(math.sqrt(n)) + 1, 2):
            if n % i == 0:
                return False
        return True

    start1, end1 = interval1
    start2, end2 = interval2

    intersection_start = max(start1, start2)
    intersection_end = min(end1, end2)

    if intersection_start > intersection_end:
        return "NO"

    return "YES" if is_prime(intersection_end - intersection_start + 1) else "NO"

