        if num < 2:
            return False
        for i in range(2, int(num**0.5) + 1):
            if num % i == 0:
                return False
        return True

    def fibonacci(n):
        if n <= 1:
            return n
        a, b = 0, 1
        for _ in range(n - 1):
            a, b = b, a + b
        return a

    count = 0
    i = 0
    while count < n:
        i += 1
        num = fibonacci(i)
        if is_prime(num):
            count += 1
    return num

