def anti_shuffle(s):
    words = s.split()
    result = []
    for word in words:
        ordered_word = ''.join(sorted(word))
        result.append(ordered_word)
    return ' '.join(result)

def get_row(lst, x):
    result = []
    for i, row in enumerate(lst):
        for j, val in enumerate(row):
            if val == x:
                result.append((i, j))
    result.sort(key=lambda x: (x[0], -x[1]))
    return result

def encrypt(s):
    result = ""
    for char in s:
        if char.isalpha():
            base = ord('a') if char.islower() else ord('A')
            result += chr((ord(char) - base + 2 * 2) % 26 + base)
        else:
            result += char
    return result

def next_smallest(lst):
    if len(lst) < 2:
        return None
    sorted_lst = sorted(set(lst))
    if len(sorted_lst) < 2:
        return None
    return sorted_lst[1]

def is_bored(S):
