def rounded_avg(n, m):
    if n > m:
        return -1
    avg = round(sum(range(n, m+1)) / (m-n+1))
    return bin(avg)

def sort_array(array):
    sorted_array = sorted(array)
    if not array or len(array) == 1:
        return array.copy()
    if (array[0] + array[-1]) % 2 == 0:
        return sorted_array[::-1]
    else:
        return sorted_array

def vowels_count(s):
    vowels = set(['a', 'e', 'i', 'o', 'u', 'A', 'E', 'I', 'O', 'U'])
    count = 0

    for i, char in enumerate(s):
        if char in vowels or (char.lower() == 'y' and i == len(s)-1):
            count += 1

    return count

def search(lst):
    from collections import Counter
    counts = Counter(lst)
    max_num = -1
    for num, freq in counts.items():
        if num > 0 and freq >= num:
            if num > max_num:
                max_num = num
    return max_num

def make_a_pile(n):
    stones = [n]
    for i in range(1, n):
        if stones[i-1] % 2 == 0:
            stones.append(stones[i-1] + 2)
        else:
            stones.append(stones[i-1] + 1 if n % 2 == 0 else stones[i-1] + 2)
    return stones

import math

def is_multiply_prime(a):
    def is_prime(n):
        if n < 2:
            return False
        for i in range(2, int(math.sqrt(n)) + 1):
            if n % i == 0:
                return False
        return True

    prime_factors = [i for i in range(2, a) if a % i == 0 and is_prime(i)]

    if len(prime_factors) != 3:
        return False

    product = 1
    for factor in prime_factors:
        product *= factor

    return product == a

def check_dict_case(dict):
    if len(dict) == 0:
        return False

    string_keys = [key for key in dict.keys() if isinstance(key, str)]

    if not string_keys:
        return False

    lowercase_keys = all(key.islower() for key in string_keys if key.isalpha())
    uppercase_keys = all(key.isupper() for key in string_keys if key.isalpha())

    return lowercase_keys or uppercase_keys

def median(l: list):
    sorted_l = sorted(l)
    n = len(sorted_l)
    mid = n // 2
    if n % 2 == 0:
        return (sorted_l[mid - 1] + sorted_l[mid]) / 2
    else:
        return sorted_l[mid]

def make_palindrome(string: str) -> str:
    if string == '':
        return ''

    for i in range(len(string), 0, -1):
        if string[:i] == string[:i][::-1]:
            if i == len(string):  # string is already a palindrome
                return string
            return string + string[i-1::-1]

def circular_shift(x, shift):
    x_str = str(x)
    shift = shift % len(x_str)
    if shift == 0:
        return x_str
    return x_str[-shift:] + x_str[:-shift] if shift < len(x_str) else x_str[-shift:][::-1] + x_str[:-shift][::-1]

