import math

def find_zero(xs: list):
    if len(xs) % 2 != 0:
        raise ValueError("Input list must have an even number of coefficients.")

    degree = len(xs) - 1
    while xs[degree] == 0:
        degree -= 1

    if degree < 1:
        raise ValueError("No non-zero coefficient found.")

    if degree == 1:  # linear equation
        return -xs[0] / xs[1]

    if degree == 2:  # quadratic equation
        a, b, c = xs[-3], xs[-2], xs[-1]
        discriminant = b**2 - 4*a*c
        if discriminant < 0:
            return None  # No real roots
        else:
            x1 = (-b + math.sqrt(discriminant)) / (2*a)
            x2 = (-b - math.sqrt(discriminant)) / (2*a)
            if x1 == x2:
                return x1
            else:
                return x1, x2

    return None

def sum_of_largest_prime_digits(lst):
    def is_prime(n):
        if n < 2:
            return False
        for i in range(2, int(n ** 0.5) + 1):
            if n % i == 0:
                return False
        return True

    def sum_of_digits(n):
        return sum(int(d) for d in str(n))

    prime_values = [num for num in lst if is_prime(num)]

    if prime_values:
        largest_prime = max(prime_values)
        return sum_of_digits(largest_prime)

    return 0

def numerical_letter_grade(grades):
    def grade(gpa):
        if gpa == 4.0:
            return 'A+'
        elif gpa > 3.7:
            return 'A'
        elif gpa > 3.3:
            return 'A-'
        elif gpa > 3.0:
            return 'B+'
        elif gpa > 2.7:
            return 'B'
        elif gpa > 2.3:
            return 'B-'
        elif gpa > 2.0:
            return 'C+'
        elif gpa > 1.7:
            return 'C'
        elif gpa > 1.3:
            return 'C-'
        elif gpa > 1.0:
            return 'D+'
        elif gpa > 0.7:
            return 'D'
        else:
            return 'D-'

    return [grade(g) for g in grades]

def f(n):
    def factorial(num):
        if num == 0:
            return 1
        else:
            return num * factorial(num - 1)

    result = []
    for i in range(1, n+1):
        if i % 2 == 0:
            result.append(factorial(i))
        else:
            result.append(sum(range(1, i+1)))

    return result

def even_odd_palindrome(n):
    def is_palindrome(num):
        return str(num) == str(num)[::-1]

    even_count, odd_count = 0, 0

    for i in range(1, n+1):
        if is_palindrome(i):
            if i % 2 == 0:
                even_count += 1
            else:
                odd_count += 1

    return (even_count, odd_count)

