def find_max(words):
    def unique_chars(word):
        return len(set(word))

    max_unique_chars = 0
    max_word = ""

    for word in words:
        curr_unique_chars = unique_chars(word)
        if curr_unique_chars > max_unique_chars or (curr_unique_chars == max_unique_chars and word < max_word):
            max_unique_chars = curr_unique_chars
            max_word = word

    return max_word

def histogram(test):
    lst = test.split()
    hist = {}
    if not lst:
        return {}
    for letter in lst:
        if letter in hist:
            hist[letter] += 1
        else:
            hist[letter] = 1
    max_count = max(hist.values())
    return {k: v for k, v in hist.items() if v == max_count}

