def can_arrange(arr):
    peak = -1
    for i in range(len(arr)-1):
        if arr[i] > arr[i+1]:
            if peak != -1:
                return -1
            peak = i
    return peak

def split_words(txt):
    if ' ' in txt:
        return txt.split()
    elif ',' in txt:
        return txt.split(',')
    else:
        return [txt]

def fix_spaces(text):
    result = []
    count = 0
    for char in text:
        if char == ' ':
            count += 1
            if count > 2:
                result.append('-')
                count = 0
            else:
                result.append('_')
        else:
            result.append(char)
            count = 0
    return ''.join(result)

def is_nested(string):
    stack = []

    for char in string:
        if char == '[':
            stack.append(char)
        elif char == ']':
            if stack and stack[-1] == '[':
                stack.pop()
            else:
                return False

    return len(stack) > 1

def tri(n):
    if n == 0:
        return []
    elif n == 1:
        return [3]
    else:
        sequence = [3]
        for i in range(1, n):
            if i % 2 == 0:
                sequence.append(1 + i // 2)
            else:
                sequence.append(sequence[i-1] + sequence[i-2] + sequence[i-3])
        return sequence

def get_odd_collatz(n):
    def collatz_seq(num):
        seq = [num]
        while num != 1:
            if num % 2 == 0:
                num //= 2
            else:
                num = 3 * num + 1
            seq.append(num)
        return seq

    return sorted([num for num in collatz_seq(n) if num % 2 != 0])

