def compare_one(a, b):
    if a == b:
        return None
    if (isinstance(a, int) or isinstance(a, float)) and (isinstance(b, int) or isinstance(b, float)):
        return a if a > b else b
    if isinstance(a, str) and isinstance(b, str):
        a = a.replace(',', '.') if ',' in a else a
        b = b.replace(',', '.') if ',' in b else b
        return a if float(a) > float(b) else b
    return a if isinstance(a, (float, int)) else b

def is_prime(n):
    if n <= 1:
        return False
    if n <= 3:
        return True
    if n % 2 == 0 or n % 3 == 0:
        return False
    i = 5
    while i*i <= n:
        if n % i == 0 or n % (i + 2) == 0:
            return False
        i += 6
    return True

def intersection(interval1, interval2):
    start1, end1 = interval1
    start2, end2 = interval2

    intersection_start = max(start1, start2)
    intersection_end = min(end1, end2)

    if intersection_start <= intersection_end:
        intersection_length = intersection_end - intersection_start + 1

        if is_prime(intersection_length):
            return "YES"
        else:
            return "NO"

    return "NO"

import hashlib

def string_to_md5(text):
    if not text:
        return None
    else:
        return hashlib.md5(text.encode()).hexdigest()

def generate_integers(a, b):
    start, end = (a, b) if a < b else (b, a)
    return [i for i in range(start, end+1) if i % 2 == 0]

from heapq import heappop, heappush

def minPath(grid, k):
    n = len(grid)
    if k == 1:
        return [min(min(grid))]

    heap = [(grid[i][0], i, 0, [grid[i][0]]) for i in range(n)]

    while heap:
        val, i, j, path = heappop(heap)
        if len(path) == k:
            return path

        for dx, dy in [(1, 0), (-1, 0), (0, 1), (0, -1)]:
            ni, nj = i + dx, j + dy
            if 0 <= ni < n and 0 <= nj < n:
                heappush(heap, (grid[ni][nj], ni, nj, path + [grid[ni][nj]]))

def solve(s):
    result = ''
    has_letter = False
    for char in s:
        if char.isalpha():
            has_letter = True
            if char.islower():
                result += char.upper()
            else:
                result += char.lower()
        else:
            result += char
    if not has_letter:
        return s[::-1]  # Reverse the input string only when no letters are present
    return result

def do_algebra(operators, operands):
    precedence = {'+': 1, '-': 1, '*': 2, '//': 2, '**': 3}

    def apply_operator(op, num1, num2):
        if op == '+':
            return num1 + num2
        elif op == '-':
            return num1 - num2
        elif op == '*':
            return num1 * num2
        elif op == '//':
            return num1 // num2
        elif op == '**':
            return num1 ** num2

    stack = []
    operator_stack = []

    for i in range(len(operators)):
        while operator_stack and precedence[operators[i]] <= precedence[operator_stack[-1]]:
            op = operator_stack.pop()
            num2 = stack.pop()
            num1 = stack.pop()
            stack.append(apply_operator(op, num1, num2))
        stack.append(operands[i])
        operator_stack.append(operators[i])

    while operator_stack:
        op = operator_stack.pop()
        num2 = stack.pop()
        num1 = stack.pop()
        stack.append(apply_operator(op, num1, num2))

    if len(stack) != 1:
        raise ValueError("Incorrect number of operands and operators provided.")

    return stack[0]
